    s = "t32 t52 t9 t46 t7 t34 t44 t37 t30 t45 t63 t15 t2 t23 t55 t39 t63 t66 t37 t13"

    def is_valid(grammar, string):
        """
        Checks if a string is generated by the given grammar.
        """
        stack = []
        for token in string:
            if token in grammar.keys():
                stack.append(token)
            else:
                if len(stack) > 0:
                    if stack[-1] == grammar.keys()[grammar.keys().index(token)]:
                        stack.pop()
                    else:
                        return False
        return len(stack) == 0

    if is_valid(s, s):
        print("Yes")
    else:
        print("No")

